import React from "react";

function Login() {
  return (
    <div>
      Log in to your account
      <div>
        <form>
          <label>Email address</label>
          <br />
          <input type="text" placeholder="enter email address" />
          <label>Email address</label>
          <br />
          <input type="password" placeholder="enter password" />
        </form>
      </div>
    </div>
  );
}

export default Login;
